import Halftone from "../Halftone"
import './card.css';

export default function CardHeader({p, title, children}) {

    return (
        <div className={`move-card-header ${p.role}`}>
            <Halftone 
                styles="card"
                color={p.role}/>
            <div className="card-header">
                {children}
                <p>{title}</p>
            </div>
        </div>
    )
}
